css:
.github-Accordion {
  cursor: default;
  user-select: none;
}
.github-Accordion-header {
  font-weight: 600;
  color: hsla(220, 13%, 66%, 0.6);
  padding: 5px;
  border-bottom: 1px solid hsl(220, 13%, 10.8%);
  display: flex;
  align-items: center;
}
.github-Accordion-header::-webkit-details-marker {
  color: hsla(220, 13%, 66%, 0.6);
}
.github-Accordion--rightTitle,
.github-Accordion--leftTitle {
  flex: 1;
}
.github-Accordion-content {
  border-bottom: 1px solid hsl(220, 13%, 10.8%);
  background-color: hsl(220, 13%, 18%);
}
.github-Accordion-content:empty::before {
  content: "Empty";
  display: block;
  font-style: italic;
  text-align: center;
  color: hsla(220, 13%, 66%, 0.6);
}
.github-Accordion-list {
  margin: 0;
  padding: 0;
  list-style: none;
}
.github-Accordion[open] .github-Accordion-header {
  color: hsl(220, 13%, 86%);
}
.github-Accordion-listItem {
  display: flex;
  align-items: center;
  padding: 2.5px;
  border-bottom: 1px solid hsl(220, 13%, 10.8%);
}
.github-Accordion-listItem:last-child {
  border: none;
}
.github-Accordion-listItem:active {
  background-color: hsl(220, 13%, 22%);
}
